    function scanShadowRoots(root) {
        try {
            if (!root) return false;
            if (tryReplaceInRoot(root, 'root')) return true;

            const all = root.querySelectorAll('*');
            for (const el of all) {
                if (el.shadowRoot) {
                    if (tryReplaceInRoot(el.shadowRoot, 'shadowRoot ' + el.tagName))
                        return true;
                    if (scanShadowRoots(el.shadowRoot)) return true;
                }
            }
            return false;
        } catch (e) {
            console.warn('[Tampermonkey] scanShadowRoots error', e);
            return false;
        }
    }

    function tryReplaceEverywhere() {
        let replaced = false;

        if (scanShadowRoots(document)) replaced = true;

        const iframes = Array.from(document.querySelectorAll('iframe'));
        for (const frame of iframes) {
            try {
                const doc = frame.contentDocument;
                if (!doc) continue;
                if (scanShadowRoots(doc)) {
                    console.info('[Tampermonkey] Replaced inside iframe', frame.src || '[inline]');
                    replaced = true;
                }
            } catch (e) {}
        }

        return replaced;
    }

